    "Lightweight Metal Rubber Wire and Cable for Space Power Systems Project",nt"tracking_summary":
    {ntt"total": 7,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-06T22:34:23.250559",nt"name": "lightweight-metal-rubber-wire-and-cable-for-space-power-systems-project",nt"isopen":
    true,nt"url": null,nt"notes": "The objective of this NASA STTR program
    is to produce ultra-lightweight electrical wire and cable harnesses to reduce the
    liftoff weight of future space flight vehicles.  In cooperation with materials scientists
    at Texas A&amp;M, NanoSonic would develop and manufacture ultra-lightweight Metal
    Rubber- and carbon nanotube-based rubber (CNT Rubber) wire and cables with performance
    equivalent to that of conventional copper cables but with only 10&#37; the weight.
     Wiring harnesses contribute significant weight load to the spacecraft structure.
     Ultra-lightweight Metal Rubber and CNT Rubber wires and cables can reduce that
    weight while offering comparable or superior electrical power and data transmission
    performance and EMI resistance.  During Phase I, NanoSonic would design, fabricate
    and test lightweight Metal Rubber and CNT Rubber wire and cable prototypes.  Texas
    A&amp;M's nanotechnology laboratory would co-develop methods for CNT Rubber production
    and evaluate resulting material properties.  The conducting core and outer shielding
    layers would be fabricated by molecular-level self-assembly.  Electrically-conducting
    cable shielding tape layers would be dimensioned using CAD-driven templating equipment
    at NanoSonic.  Wire and cable would be manufactured using wire feed, dielectric
    extrusion and shielding tape winding steps.  NanoSonic is working with a major U.S.
    cable manufacturer and a major U.S. spacecraft prime contractor on this program.",nt"license_title":
